import react from 'react'

import { NativeRouter, Switch, Route } from 'react-router-native';

import LogIn from './src/Pages/LogIn'

export default function App() {
  return (
    <NativeRouter>
      <Switch>
        <Route exact path='/' component={LogIn}/>
      </Switch>
    </NativeRouter>
  )
}
